import s from "./FeedbackOptions.module.css";

const FeedbackOptions = ({ options }) => {
  return (
    <>
      <ul className={s.conteiner}>
        {options.map((option) => (
          <li>
            <button type="button">{option}</button>
          </li>
        ))}
      </ul>
    </>
  );
};

export default FeedbackOptions;
